      .then((response) => response.json())
      .then((response) => {response}) 
      .catch(err => console.error(err));
    console.log(currentWeatherFetch)
  }

  return (
    <div className="container">
      <Search onSearchChange={handleOnSearchChange}/>
      <CurrentWeather />
    </div>
  );
}

export default App;
